import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function Register() {

    const [first_name, Setfirst_name] = useState("")
    const [last_name, Setlast_name] = useState("")
    const [email, SetEmail] = useState("")
    const [password, SetPassword] = useState("")

    function handleAdd(e) {
        e.preventDefault()

    fetch('http://127.0.0.1:9292/auth/register', {
        method: 'POST',
        body: JSON.stringify({
            first_name: first_name,
            last_name: last_name,
            email: email,
            password: password
    })
    })
    .then(response => response.json())
    .then(data => {
        console.log(data)
        navigate("/dashboard")
    })
    .catch(error => console.error(error))
    }

    return(
        <form className="regnav" onSubmit={e => handleAdd(e)}>
            <input type="hidden" name="movie[user_id]" value="<%= @user.id %>"></input>
            <label>first_name:</label>
            <input type="text" value={first_name} onChange={e => Setfirst_name(e.target.value)}></input>
            <label>last_name:</label>
            <input type="text" value={last_name} onChange={e => Setlast_name(e.target.value)}></input>
            <label>Email:</label>
            <input type="text" value={email} onChange={e => Seail(e.target.value)}></input>
            <label>Password:</label>
            <input type="number" placeholder="Only numerical values are allowed" value={password} onChange={e => SetPass(e.target.value)}></input>
            <input type="submit" value="Add User"></input>
      </form>
    )
}

export default Register;
